    const [latLng, updateLat]= useState();
    const [isParked ,setParked] = useState(false);



    return(<div>
            <NavBarComp />    
            <button onClick={()=> updateLat(locationManager.getUserCurrentLocation(latLng.lat , latLng.lng ))}>Save Location</button>
            {latLng ?   <CarParkedComp lat={latLng.lat} lng={latLng.lng} />  : <div>No Location Found</div>}
        </div> )
    }



